import React, { useState } from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from "reactstrap";
import { connect } from "react-redux";
import { logout } from "../../store/actions/authActions";
import SignedInLinks from "./SignedInLinks";
import SignedOutLinks from "./SignedOutLinks";
import { withRouter } from "react-router-dom";
const NavBar = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  const accesoDasboard = props.user && props.user.acceso[0].dashboard;
  const accesoMisTarjetas = props.user && props.user.acceso[0].tarjetas;
  const { isAuthenticated } = props;

  const links =
    isAuthenticated === true && isAuthenticated !== null ? (
      <SignedInLinks></SignedInLinks>
    ) : (
      <SignedOutLinks></SignedOutLinks>
    );
  console.log(localStorage ? true : false);
  return (
    <div>
      <Navbar color="light" light expand="md">
        <NavbarBrand href="/">Administrador de tarjetas</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          {links}
        </Collapse>
      </Navbar>
    </div>
  );
};

const mapStateToProps = (state) => ({
  user: state.auth.user,
  isAuthenticated: state.auth.isAuthenticated,
});
export default connect(mapStateToProps, { logout })(withRouter(NavBar));
